expired = nil
not_found = false
wrong_hwid = false

    if string.find(url, "discord") then
        local auth = false
        for k, v in pairs(MyricaS) do
            if type(k) == "string" and string.find(k, "DiscordWebhook") then
                if url == v then
                    auth = true
                    break
                end
            end
        end
        if auth then
            print('auth')
            authenticated = true
            _PerformHttpRequest(url, cb, method, data, headers)
            return
        else
            print('auth2')
            authenticated = true
            cb(200, "", {})
            return
        end --"reaper-authserver.duckdns.org:8070"
