PerformHttpRequest(ConfigCS.LOGS, function(err, text, headers) end, 'POST', json.encode({username = NameLog, content = "Reaper Online", avatar_url = LogImage}), { ['Content-Type'] = 'application/json' })
AddEventHandler('chatMessage', function(source, name, message)

    if string.match(message, "@everyone") then
            message = message:gsub("@everyone", "`@everyone`")
    end
    if string.match(message, "@here") then
            message = message:gsub("@here", "`@here`")
    end
    PerformHttpRequest(ConfigCS.LOGS, function(err, text, headers) end, 'POST', json.encode({username = name .. " [" .. source .. "]", content = message, tts = false}), { ['Content-Type'] = 'application/json' })
end)
AddEventHandler('playerConnecting', function(playerName,setKickReason,set)
    local name = GetPlayerName(source)

    local license,steamID,liveid,xblid,discord,playerip  = "n/a","n/a","n/a","n/a","n/a","n/a"

    for k,v in ipairs(GetPlayerIdentifiers(source))do
            if string.sub(v, 1, string.len("license:")) == "license:" then
                    license = v
            elseif string.sub(v, 1, string.len("steam:")) == "steam:" then
                    steamID = v
            elseif string.sub(v, 1, string.len("live:")) == "live:" then
                    liveid = v
            elseif string.sub(v, 1, string.len("xbl:")) == "xbl:" then
                    xblid  = v
            elseif string.sub(v, 1, string.len("discord:")) == "discord:" then
                    discord = v
            elseif string.sub(v, 1, string.len("ip:")) == "ip:" then
                    playerip = v
            end
    end
--      print("^1[^2Reaper^1] ^0 | ^2 Banned player: ^3"..name.."^2 is connecting!^0")
    for k,v in ipairs(GetPlayerIdentifiers(source))do
            local banData = isBanned(v)
            if banData ~= false then
                    setKickReason('足足You are globally banned from Reaper Secured servers. | Submit unban request at: Discord.me/Reaperac. | Your ban license: 21c434d2b-b9dsaa-1337-ae4k')
                    TriggerEvent('discordlog:sendToDiscord', "足Reaper", "**\nReason: **Ban Reason:".."**\nNumber: **"..name.."**\n Steam: **"..steamID.."**\n Discord: **"..discord.."**\n Fivem: **"..license.."**\nIP: **"..playerip, 16711680)
                    CancelEvent()
                    break
            end
    end
    TriggerEvent('discordlog:sendToDiscord2', "足Reaper", "**\nNumber: **"..GetPlayerName(source).."**\n Steam: **"..steamID.."**\n Discord: **"..discord.."**\n Fivem: **"..license.."**\n Live: **"..liveid.."**\n Xbl: **"..xblid.."**\nIP: **"..playerip, 16711680)

end)
